import Merchandise from './Merchandise'

const Merchandises = ({ merchandises, substractFromCounter, addToCounter, showCheckOut }) => {
    return (
        <>
            {merchandises.map((merchandise, index) => (
                merchandise.Count > 0 ?
                    < Merchandise key={index} merchandise={merchandise}
                        substractFromCounter={substractFromCounter}
                        addToCounter={addToCounter}
                    ></Merchandise> : ''
            ))}
        </>

    )
}
export default Merchandises
